import React, { useState } from 'react';

function Counter () {
  const [counter, setCounter] = useState(0);

  const onClickCounterP = () => {
    setCounter(counter + 1)
    console.log('+1');
  };

  return (
    <div>
      <p>
        <button onClick ={onClickCounter} className="py-3">+1 Button</button>
        {counter}
      </p>
    </div>
  );
}

export default Counter;
